using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using UnityEngine.SceneManagement;


public class CostaMinimalSurface : MonoBehaviour
{
    public Mesh mesh = null;
    int uSize = 80;//uの分割数
    int vSize = 80;//vの分割数
    public Vector3[] vertices;//頂点の列
    public int[] triangles;//三角形のデータ
    public int change;
    public bool SideA;

    public GameObject CameraRig;
    public Vector3 eyeHeight = Vector3.up;

    public float constA;//定数
    public float alpha;
    // Start is called before the first frame update
    void Start()
    {
        uSize = 80;
        vSize = 80;
        vertices = new Vector3[(uSize + 1) * (vSize + 1)];//頂点の座標
        triangles = new int[uSize * vSize * 6];//三角形の個数*3の長さの配列
        constA = 1.7f;
        alpha = 1.0f;

        InitVertices();
        if (mesh == null)
        {
            mesh = new Mesh();
        }
        InitMesh();

        change = 0;
    }

    // Update is called once per frame
    void Update()
    {
        UpdateButton();
    }

    void UpdateButton()
    {

        if (OVRInput.GetDown(OVRInput.Button.Start))
        {
            SceneManager.LoadScene("Scenes/Main");
        }
        else if (OVRInput.GetDown(OVRInput.Button.Two))
        {
            change = 1 - change;
            InitVertices();
            InitMesh();
        }

    }

    void InitVertices()
    {
        for (int u = 0; u <= uSize; u++)
        {
            for (int v = 0; v <= vSize; v++)
            {
                float uu = 2f * Mathf.PI * u / (uSize);
                float vv = -Mathf.PI / 2f + Mathf.PI * v / (vSize);
                vertices[u * (vSize + 1) + v] = new Vector3(surfaceX(u,v), surfaceY(u, v), surfaceZ(u, v));
            }
        }
        for (int u = 0; u < uSize; u++)//三角形の頂点のデータを作っている
        {
            for (int v = 0; v < vSize; v++)
            {
                if(VertexInArea(u * (vSize + 1) + v)&& 
                    VertexInArea((u+1) * (vSize + 1) + v)&& 
                    VertexInArea(u * (vSize + 1) + v+1)&&
                    VertexInArea((u+1) * (vSize + 1) + v + 1)) { 
                    if (SideA)
                    {
                        triangles[6 * (u * vSize + v) + 0] = u * (vSize + 1) + v;
                        triangles[6 * (u * vSize + v) + 1] = (u + 1) * (vSize + 1) + v;
                        triangles[6 * (u * vSize + v) + 2] = u * (vSize + 1) + (v + 1);
                        if (change == 0)
                        {
                            triangles[6 * (u * vSize + v) + 3] = u * (vSize + 1) + (v + 1);
                            triangles[6 * (u * vSize + v) + 4] = (u + 1) * (vSize + 1) + v;
                            triangles[6 * (u * vSize + v) + 5] = (u + 1) * (vSize + 1) + (v + 1);
                        }
                        else
                        {
                            triangles[6 * (u * vSize + v) + 3] = 0;
                            triangles[6 * (u * vSize + v) + 4] = 0;
                            triangles[6 * (u * vSize + v) + 5] = 0;

                        }
                    }
                    else
                    {
                        triangles[6 * (u * vSize + v) + 0] = u * (vSize + 1) + v;
                        triangles[6 * (u * vSize + v) + 1] = u * (vSize + 1) + (v + 1);
                        triangles[6 * (u * vSize + v) + 2] = (u + 1) * (vSize + 1) + v;
                        if (change == 0)
                        {
                            triangles[6 * (u * vSize + v) + 3] = u * (vSize + 1) + (v + 1);
                            triangles[6 * (u * vSize + v) + 4] = (u + 1) * (vSize + 1) + (v + 1);
                            triangles[6 * (u * vSize + v) + 5] = (u + 1) * (vSize + 1) + v;
                        }
                        else
                        {
                            triangles[6 * (u * vSize + v) + 3] = 0;
                            triangles[6 * (u * vSize + v) + 5] = 0;
                            triangles[6 * (u * vSize + v) + 4] = 0;

                        }
                    }
                }
            }
        }

    }

    bool VertexInArea(int index)
    {
        if (index < 0 || (uSize + 1) * (vSize + 1) <= index) return false;
        Vector3 v = vertices[index];
        if(Mathf.Abs(v.x) > 8 || Mathf.Abs(v.y) > 8 || Mathf.Abs(v.z) > 8)
        {
            return false;
        }
        return true;

    }

    void InitMesh()
    {
        mesh.vertices = vertices;
        mesh.triangles = triangles;
        mesh.RecalculateNormals();
        GetComponent<MeshFilter>().sharedMesh = mesh;
        //GetComponent<MeshCollider>().sharedMesh = mesh;
    }

    float surfaceX(int u, int v)
    {
        return (float)coord[u,v,0];
    }

    float surfaceY(int u, int v)
    {
        return (float)coord[u, v, 2];
    }

    float surfaceZ(int u, int v)
    {
        return (float)coord[u, v, 1];
    }

